import React from 'react';
import {Button} from '@material-ui/core';


export const Money = () => {
  state = {
    show: false
  };
  showModal = e => {
    this.setState({
      show: true
    });
  };

  return (
    <div>
      <h1>Money Status</h1>
      <h3>Total money ==> 10,000</h3>
      <form>
        <Button variant="contained" color="primary">Create Coins</Button>
      </form>
      <Button  onClick={e => {
              this.showModal();
         }}
          > show Modal </Button>
    </div>

  )
}
